import Link from 'next/link';


const Navbar = () => (

    
        <ul>
             <li><Link to = "/"> <text> Home </text> </Link> </li>
            <li><Link to = "/about"> <text> about </text> </Link> </li>
            
        </ul>

    

);

export default Navbar;
